import React, { Component } from "react";
import axios from "axios";
import Produto from "./Produto";
import "./index.css";
import MyHeader from "./Header.js";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      feed: [
        { id: 1, descricao: "scarpin", quantidade: 10, valor: 150 },
        { id: 2, descricao: "oxford", quantidade: 20, valor: 140 },
        { id: 3, descricao: "bota", quantidade: 30, valor: 130 }
      ]
    };
  }

  componentWillMount() {
    axios
      .get("")
      .then(response => {
        console.log(response.data);
        this.setState({
          feed: [
            { id: 1, descricao: "scarpin", quantidade: 10, valor: 150 },
            { id: 2, descricao: "oxford", quantidade: 20, valor: 140 },
            { id: 3, descricao: "bota", quantidade: 30, valor: 130 }
          ]
        });
      })
      .catch(erro => console.log(erro));
  }

  render() {
    return (
      <div>
        <MyHeader />

        {this.state.feed.map(item => {
          return (
            <div key={item.id}>
              <h3>
                {" "}
                {item.descricao}{" "}
                <h2>
                  {" "}
                  {item.quantidade}, {item.valor}{" "}
                </h2>{" "}
              </h3>
            </div>
          );
        })}
      </div>
    );
  }
}
